import React from "react";
import "./App.css";
import Customer from "./Component/customer";

const customers = [
  {
    id: 1,
    img: "https://placeimg.com/64/64/any",
    name: "Jane",
    bday: "560711",
    gender: "Female",
    job: "Marketing",
  },
  {
    id: 2,
    img: "https://placeimg.com/64/64/any",
    name: "Alex",
    bday: "560711",
    gender: "Female",
    job: "Designer",
  },
  {
    id: 3,
    img: "https://placeimg.com/64/64/any",
    name: "Poo",
    bday: "560711",
    gender: "Male",
    job: "Dev",
  },
];

function App() {
  return (
    <div className="background">
      <Customer
        id={customers.id}
        img={customers.img}
        name={customers.name}
        bday={customers.bday}
        gender={customers.gender}
        job={customers.job}
      />
    </div>
  );
}

export default App;
